import numpy as np
import struct
import base64

def unpack_feature_from_stream(stream):
    decoded_stream = base64.decodestring(stream)
    fmt = '>' + str(len(decoded_stream) / 4) + 'f'
    feature = struct.unpack(fmt, decoded_stream)

    return feature

